import React from 'react';

export function Ip(props) {
    const _userData = JSON.parse(localStorage.getItem("userDetails"));
   const _data = [
    "asds","asdsad","asfasdasd","Asdas","asdasdsad"
    ]
    return(
        <div className="container">
            <div className="row">
                <div className="col-md-6 justify-content-*-center">
                    {
                        _data.map(e => {
                            return(
                                <div className="card card-signin my-5">
                                    <div className="card-body ">
                                        <div className="row flex-display">
                                            <div className="col-md-8 form-label-group">
                                                <input type="email" id="i-email" className="form-control" placeholder="IP address" required autoFocus  />
                                                <label htmlFor="i-email" >Add IP address</label>
                                            </div>
                                            <div className="col-md-1">
                                                <button className="btn btn-lg btn-primary" type="submit">+</button>
                                            </div>
                                            <div className="col-md-1"></div>
                                            <div className="col-md-1">
                                            <button className="btn btn-lg btn-primary" type="submit">-</button>
                                            </div>
                                        </div>
                                        <div className="row">
                                        <div className="col-md-8 form-label-group">
                                            <button className="btn btn-lg btn-primary btn-block text-uppercase" type="submit">Save</button>
                                        </div>
                                        </div>
                                    </div>
                                </div>
                            )
                        })
                    }
                </div>
            </div>
        </div>
    );
}
export default Ip;
